import React from 'react';
import LinhaLivro from './LivroLista';
import './App.css';

function App() {
  return (
    <table>
      <tr>
          <th>Titulo</th>
          <th>Resumo</th>
          <th>Editora</th>
          <th>Autores</th>
      </tr>
      <LinhaLivro/>
    </table>
  );
}

export default App;
